import './App.css'
import One from './inc/One';
import Test from './inc/Test';
import { BrowserRouter, Route } from 'react-router-dom';

function App() {
  return (
    <div>
      <BrowserRouter>
        <Route path='/' exact Component={One} />
        <Route path='/test' Component={Test} />
      </BrowserRouter>
    </div>
  );
}

export default App;
